"/assets/d5065f37-06a6-472d-8265-7aaf370a37cf-a4623141.png",J="/assets/d7b8bc39-67ed-4e4f-ad21-debac62b4c66-54eed884.png",F="/assets/image-20221009135305300-de31fea7.png",W="/assets/image-20221009135509628-f1218ba6.png",N="data:image/png;base64,",_="/assets/image-20221009135630524-80717fe3.png",$="data:image/png;base64,",AA="data:image/png;base64,",aA="/assets/image-20221009135831728-e504a03f.png",sA="/assets/4b6d3168-91e3-4708-bc86-3e345c514d50-5338d8a0.png",pA="/assets/image-20221009140205025-1780d527.png",eA="/assets/image-20221009140255158-b1fbafd6.png",tA="/assets/288a1f73-1d5b-4c88-9fac-461edb0042d3-0ee9f1ee.png",gA="/assets/f1411a2d-e843-4d1c-9ae3-cc283b61ffc6-d88e36ec.png",cA="/assets/0bb56f96-3a1d-47f8-be46-30042255a54d-28131a22.png",iA="/assets/b0c0471b-8321-4277-a405-77988f638046-6ae3365e.png",oA="/assets/32071e58-082f-4d33-a7d3-1a3626efd1f1-68e20aae.png",rA="/assets/0b5f77b4-1357-43fa-a041-65cb7c7255fc-441b98c1.png",nA="data:image/png;base64,",dA="/assets/9b19b6c5-6873-4cd3-8aaf-d4c80840d07a-fe777def.png",bA="data:image/png;base64,",mA="/assets/1bd6d225-d2cc-471e-afb8-d2c24c009c93-1638da63.png",lA="/assets/ef6a30b9-17e8-4bb5-8d2b-cccbac7b34d7-bd5ef4b8.png",fA="/assets/1666593410091-aeadb33a.png",hA="/assets/1666751227639-d31bccf3.png",BA="/assets/e82a1bf1-0e9e-40be-a617-80ba80440747-828ac6f4.png",EA="/assets/e9947b28-8e90-43b0-b71e-8d3affb80b0a-ad313f89.png",VA="data:image/png;base64,",qA="data:image/png;base64,",uA="/assets/f166c425-b770-4e62-8974-71918170308a-abd348b6.png",QA="/assets/6cfd3c13-942f-450d-8642-683b73c063d3-f2c498fd.png",vA="/assets/4ce6ce31-90f8-4824-91c5-72344e5acc49-514fad6c.png",CA="data:image/png;base64,",ZA="data:image/png;base64,",zA="/assets/image-20221009143544705-2f51eb6c.png",wA="/assets/0ad19a6c-d9ee-4bc3-8d57-62a50b42fff4-58682ea2.png",PA="/assets/image-20221009143735968-b2bf8d23.png",xA="data:image/png;base64,",IA="data:image/png;base64,",UA="/assets/download_image-1-6da81f3a.png",MA="/assets/image-20221009144840910-83bc429b.png",RA="/assets/image-20221009144953438-54f97957.png",jA="/assets/image-20221009145102188-1d3dfc92.png",kA="/assets/image-20221009150436864-f29bbd8a.png",KA="/assets/image-20221009173047999-888f858e.png",GA="/assets/image-20221009173149332-bd01c9b1.png",DA="data:image/png;base64,",yA="/assets/c2d1ea2c-7ec5-4b34-bba0-ab8dfe84ac13-b5891968.png",XA="data:image/png;base64,",OA="/assets/image-20221010133506680-defd6295.png",LA="/assets/image-20221010133735847-52470d5b.png",TA="/assets/image-20221010133800411-df8133b7.png",SA="data:image/png;base64,",YA="/assets/image-20221010134448284-35b4009e.png",HA="data:image/png;base64,",JA="/assets/image-20221010134627484-28e66570.png",FA="/assets/image-20221010135021706-9e0b05e9.png",WA="/assets/image-20221010135213825-8383d57c.png",NA="/assets/image-20221010135244398-9647d958.png",_A="/assets/image-20221010135320746-988d2774.png",$A="/assets/image-20221010135447043-90dc3a4c.png",Aa="/assets/image-20221010135525479-067b3203.png",aa="/assets/image-20221101100800603-1a9aefd2.png",sa="/assets/image-20221010135905110-d999ddb8.png",pa="data:image/png;base64,",ea="/assets/image-20221010140027352-a7b0ec57.png",ta="/assets/image-20221010140058641-ded3b062.png",ga="/assets/image-20221101095313226-0d6a0f93.png",ca="/assets/image-20221101095610836-4b08a647.png",ia="/assets/image-20221010140758493-6b71c67e.png",oa={},ra=e('<h1 id="考试管理" tabindex="-1"><a class="header-anchor" href="#考试管理" aria-hidden="true">#</a> 考试管理</h1><h2 id="新建考试" tabindex="-1"><a class="header-anchor" href="#新建考试" aria-hidden="true">#</a> 新建考试</h2><p><strong>创建考试</strong></p><p><img src="'+o+'" alt="download_image"></p><p>点击新建考试，即可创建一场新的考试。</p><p>新建考试需要填写将“基本信息”、“考试配置”中必填选项填写完成，考试才可保存。</p><p>基本信息必填项：考试编号-考试名称-选择报名模板</p><p><strong>考试编号</strong> 系统建议的考试编号格式为(六位数字)：年份后两位 + 月份（01,02,...,12）+ 日期（01,02,...,31）,例如190101</p><p><img src="'+r+'" alt="37500860-2cfe-4bc7-87bf-e8ef30e1018d"></p><p>（2）考试配置必填项：选择考试类型-举办机构-收费类型-报名起止时间-审核起止时间 考试配置中需要特别注意报名时间选择，若是修改起始时间会变动，需要核对无误再保存。审核结束时间应设置晚于报名时间。</p><p><img src="'+n+'" alt="50c0bbec-e693-4ee6-aee5-d11c92fffa15"></p><p><img src="'+d+'" alt="cab1965c-c6a8-4b27-ac4b-e6430a6496ff"></p><p><img src="'+b+'" alt="51a9e185-494b-4acb-899d-8d680df4c196"></p><p><img src="'+m+'" alt="656f539d-ea9b-4bed-9cba-fdee4a10145d"></p><p><strong>考生确认</strong></p><p><img src="'+l+'" alt="29d6ed24-3c7a-4130-adb8-acafd974e808"></p><p>考试配置中设定是否需要考生在审核结果查询截止时间前确认参加考试，没有确认的考生默认不编排进入考场，有助于减少考场编排中的资源浪费。</p><p><strong>报名系统服务费</strong></p><p><img src="'+f+'" alt="8097d8b5-a21c-436d-965c-e342684dfff9"></p><p>说明：如果向考生收取报名系统服务费，请填写具体金额，不收取该费用请填写0或者不填写。(报名系统服务费不支持退款,,若设置报名系统服务费，考生未缴费无法查看报名表，管理端看不到考生报名信息；考生缴费完成后可以看到考生报名信息进行审核)</p><p><strong>准考证号</strong></p><p><img src="'+h+'" alt="1665276692530"></p><p>准考证生成规则： 一般默认是前缀（一般6位数）+考场号（3位补全）+座位号（2位补全）共11位数，例如21011500101，也可以自定义准考证号，可以编入考点和职位代码，由于excel特性，最长不要超过15位数。 3位补全是设置号码为1，系统自动生成001；2位补全是设置为1，系统自动生成01；自动是设置号码为1，系统生成为1。</p><p>（3）笔试配置项目：（可根据实际情况选填，收费考试须设置笔试支付起始时间，免费考试不须设置，其他项目须根据公告内容填写可跳过不填，保存考试即可）</p><p><img src="'+B+'" alt="1fd2a2c5-6aac-49e9-aa8c-cd52645c1b5b"></p><p>（4）面试配置项目：（可根据实际情况选填，收费考试须设置面试支付起始时间，免费考试不须设置，其他项目须根据公告内容填写可跳过不填，保存考试即可）</p><p><img src="'+E+'" alt="0fcfb2f0-2dfb-4da2-a3f9-a2828f2f78fa"></p><p>填完所有基本内容点击保存,可以在考试项目中查找我们刚创建的考试</p><p><img src="'+V+'" alt="60c429e9-6079-456e-89b4-b791ec41e897"></p><p>点击<img src="'+q+'" alt="1667266808233(1)">查看报名端考试项目主页</p><p><img src="'+u+'" alt="image-20221101094336812"></p><p>可在考试配置-其他选项中开启开启关闭项目流程状态</p><p><img src="'+Q+'" alt="image-20221101094417132"></p><p><strong>考试状态</strong></p>',34),na=A("strong",null,"测试阶段",-1),da={href:"https://www.kancloud.cn/pinge/ksxt/2104800",target:"_blank",rel:"noopener noreferrer"},ba={href:"https://www.kancloud.cn/pinge/ksxt/1359414",target:"_blank",rel:"noopener noreferrer"},ma=A("strong",null,"发布阶段",-1),la=e('<p><img src="'+v+'" alt="1665278344373"></p><p><strong>门贴标题</strong></p><p><img src="'+C+'" alt="1665275602530(1)"></p><p>后期笔试配置中需要填写，一般和公告考试名称一致</p><p>二、考试项目列表页鼠标移入报名时间即弹出该考试所有时间线预览</p><p><img src="'+Z+'" alt="1665278344373"></p><p>可核对时间设置是否正确，如若不正确可点击考试配置修改保存</p><hr><h2 id="职位管理" tabindex="-1"><a class="header-anchor" href="#职位管理" aria-hidden="true">#</a> 职位管理</h2><p><img src="'+z+'" alt="8534bbd9-e42e-4986-820b-f03c5472cd3c"></p><p>根据设置的报名日期，把考试分为三类，正在报名，即将开始，结束报名。</p><p><strong>新增已归档类别：把已结束的考试进行存档。</strong></p><p><img src="'+w+'" alt="b22c51f6-1e9f-4ce5-bf8a-a9c8772c9a6b"></p><blockquote><p>职位的设置需在报名日期前设置完毕，当报名开始时，请慎重修改职位信息。</p></blockquote><p><strong>职位筛选</strong></p><p><img src="'+P+'" alt="1651125634(1)"></p><p>可以根据职位缴费类型以及考试类型或者搜索框搜索筛选职位</p><p><strong>新增职位</strong></p><p><img src="'+x+'" alt="1665279191945"></p><p>点击新增职位，即会出现以下窗口</p><p><img src="'+I+'" alt="f18960a9-2b83-4679-a6ba-1bc19946570a"></p><p><strong>正常/暂停接受报名</strong></p><p><img src="'+U+'" alt="77dad685-409f-46cd-b2a1-fb51b1be051f"></p><p>通过下拉框选择职位是否接受报名，暂停接受报名考生报名时没有该职位选项</p><ul><li>如没有职位代码，请用01，02，03代替</li><li>报名模板 功能将会在 模板管理中详细说明</li><li>考试科目代码：如果有两门或以上科目，请用 | 分割，例如（01|02）</li><li>笔试起止时间：如果有两门或以上科目，请用 | 分割，例如（9:00-11:00|14:30-16:30）</li><li>考试科目名称：如果有两门或以上科目，请用 | 分割，例如（职业能力测试|申论）</li><li>笔试成绩标签：如果有两门或以上科目，请用 | 分割，例如（职业能力测试|申论）</li><li>职位要求：针对该岗位的招聘需求，如学历要求或者年龄要求等。考生选择报考该岗位时会看到所填内容</li><li>报名条件：设置报名条件后，系统在考生报名时会自动拒绝不符合条件的报名，具体设置如下图所示</li></ul><p><img src="'+M+'" alt="b56d3abb-d1ab-4cb2-86f9-10dcbe2bddd0"></p><ul><li>如招考条件为：本科及以上，则条件应该把本科和本科以上的学历都选择添加。若有年龄要求，则在年龄输入框中输入生日起点限制。</li><li>注：在 <strong>模板管理 - 表单字段 - 自定义字段</strong>中新建的非文本类型字段，并插入到报名列表中，也会出现在报名条件中。</li></ul><p><strong>编辑职位</strong></p><p><img src="'+R+'" alt="1665279441849"></p><p>点击<img src="'+j+'" alt="image">按钮即可查看并修改已添加的职位</p><p><strong>复制职位</strong></p><p>为简化操作，若有类似职位可点击<img src="'+k+'" alt="download_image"></p><p>复制按钮，在弹出的框中修改为新增职位即可快速新建其他职位。</p><p><strong>导出职位数据，导入职位信息</strong></p><p><img src="'+K+'" alt="0375f60c-d656-4f66-be60-3d285a2bec28"></p><p>点击<img src="'+G+'" alt="1651123652(1)">导出职位数据空表</p><p><img src="'+D+'" alt="f1f92ee3-d1c8-4a91-a87c-9c0e15609129"></p><p>填写需要添加的职位信息</p><p><img src="'+y+'" alt="1651124705(1)"></p><blockquote><p>导出后需要选中表格全部内容，把单元格格式设置为文本，日期以XXXX-XX-XX格式填写，开考比例使用1:X格式填写，其中&quot;:&quot;用英文填写，涉及到数值类的内容用数字填写</p></blockquote><p>点击<img src="'+X+'" alt="a3c60889-6d89-435d-926f-5cf73d1faad3">弹出</p><p><img src="'+O+'" alt="8294e68d-e631-4ceb-b163-b440712c1b61"></p><p>把编辑好的职位数据表上传，导入成功后弹窗提示</p><p><img src="'+L+'" alt="d24c22a5-3cc7-408d-87ca-5bbf3b24ea5a"></p><p>职位里显示导入信息内容</p><p><img src="'+T+'" alt="1651124737(1)"></p><blockquote><p>导入前需要创建好报名模板并在考试配置里选择需要使用的模板</p></blockquote><p><strong>职位报名人数显示</strong></p><p><img src="'+S+'" alt="5405639a-26e7-4fed-9a29-f1b09256a8b6"></p><hr><h2 id="考点管理" tabindex="-1"><a class="header-anchor" href="#考点管理" aria-hidden="true">#</a> 考点管理</h2><p><img src="'+Y+'" alt="df55ee13-5931-4f3e-9d32-6621a1db9428"></p><p><strong>新增考点</strong></p><p>点击新增考点，即会弹出以下窗口</p><p><img src="'+H+'" alt="d5065f37-06a6-472d-8265-7aaf370a37cf"></p><ul><li>考点编号：若没有特定编号，则按默认编号01，02填写</li><li>考点名称：考试地点，比如某某学校，某某考试基地</li><li>考点地址：具体详细地址，比如某个区多少号几楼</li><li>备 注：考生前往考点的交通说明等其他内容</li></ul><p><strong>编辑考点</strong></p><p><img src="'+J+'" alt="d7b8bc39-67ed-4e4f-ad21-debac62b4c66"></p><p>点击任一创建好的考点后的编辑按钮，即可修改考点信息</p><h3 id="考场管理" tabindex="-1"><a class="header-anchor" href="#考场管理" aria-hidden="true">#</a> 考场管理</h3><blockquote><p>请在报名，审核，缴费全部结束，确定考生人数后再编排考场</p></blockquote><p><img src="'+F+'" alt="image-20221009135305300"></p><p>点击任一考点后的考场按钮，即可进入考场编排页面</p><p><img src="'+W+'" alt="image-20221009135509628"></p><p>点击<img src="'+N+'" alt="image-20221009135531623">按钮，会弹出如下窗口</p><p><img src="'+_+'" alt="image-20221009135630524"></p><p>考场座位数默认为30，可修改为任一数字。点击预览按钮后，系统会根据考生人数以及考场座位数，按照职位顺序创建考场座位预览表。确认没问题后，点击<img src="'+$+'" alt="image-20221009135728928"></p><p>即可生成考场。</p><p><strong>批量添加考场</strong></p><p>点击<img src="'+AA+'" alt="image-20221009135806559">按钮，会弹出如下窗口</p><p><img src="'+aA+'" alt="image-20221009135831728"></p><p>选择对应的考试科目(职位)，会显示该职位下待编排人数。可以添加编排范围条件对考生进行筛选编排。若考场终止编号y不等于起始编号x，保存成功后，则会出现y-x+1个考场。</p><p><strong>添加技巧</strong></p><p>若职位1有59人，每个考场有30张座位，则在批量添加考场时，考场起始编号为1，终止编号为2，终止座位号为30，保存后会出现两个考场。这时，只需要在第二个考场，修改终止座位号为29，即可创建完成。</p><p>如果座位连续，则2考场剩余的1个座位则需要单独添加。点击批量添加考场，考试科目选择科目2，考场起始编号填2，终止编号填2，起始座位号为30，终止座位号为30。随后第三考场继续排入职位2的考生即可。</p><blockquote><p>注意：自定义编排考场任务之细，需要谨慎编排，认真检查，若中间有任一考场出错，则后续的考场都需要修改。</p></blockquote><h1 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h1><p>面试考点，考点类型选择面试，编号名称根据实际填写，备注可以填写时间，实现把不同考生分在不同时间面试操作</p><p><img src="'+sA+'" alt="4b6d3168-91e3-4708-bc86-3e345c514d50"></p><hr><h2 id="考生管理" tabindex="-1"><a class="header-anchor" href="#考生管理" aria-hidden="true">#</a> 考生管理</h2><p><img src="'+pA+'" alt="image-20221009140205025"></p><p><img src="'+eA+'" alt="image-20221009140255158"></p><p>考生列表：查看并审核考生</p><p>编排考场：报名，审核，缴费，创建考场完成后，将考生编排至考场中</p><p>留言单：每个考场的所有考生表，打印用，方便考官对考生签到</p><p>桌贴：考场座位上的考生身份贴纸，打印用，方便考生确定座位</p><p>门贴：每个考场的考试信息，打印用，方便考生和考官确定考场</p><p>笔试：所有进入笔试的考生名单，可下载笔试考生表，下载空白成绩表，上传填好的成绩表</p><p>面试：所有进入面试的考生名单，缴费状态表示最终进入面试的名单</p><h3 id="考生列表" tabindex="-1"><a class="header-anchor" href="#考生列表" aria-hidden="true">#</a> 考生列表</h3><p><img src="'+tA+'" alt="288a1f73-1d5b-4c88-9fac-461edb0042d3"></p><ul><li>系统会根据报名的<strong>时间顺序由后至先</strong>排序</li><li><strong>准考证号</strong> 在编排考场完成才会确定</li><li><strong>备注</strong> 是对考生的特殊说明或者是考试加分政策及其他</li><li>鼠标放在<strong>缴费状态</strong> 上可以看到考生缴费时间、金额、方式</li></ul><p><strong>筛选</strong></p><p><img src="'+gA+'" alt="f1411a2d-e843-4d1c-9ae3-cc283b61ffc6">选择需要筛选的条件，系统将自动筛选出符合条件的考生。</p><p><strong>导出报名数据</strong></p><p>点击<img src="'+cA+'" alt="0bb56f96-3a1d-47f8-be46-30042255a54d"></p><p>按钮，即可导出所有（包含不合格）考生的所有报名信息。</p><p>（下图为导出的报名表，在红线框内可以修改是否合格及原因）</p><p><img src="'+iA+'" alt="b0c0471b-8321-4277-a405-77988f638046"></p><p><strong>导入</strong></p><p>点击导入审核结果按钮，即可导入</p><p>（首先导出未审核的报名表，表格格式默认为Excel格式，报名表审核完毕后在点击导入即可）</p><p><img src="'+oA+'" alt="32071e58-082f-4d33-a7d3-1a3626efd1f1"></p><p><strong>审核</strong></p><p>在审核时间段内，列表显示为下图</p><p><img src="'+rA+'" alt="0b5f77b4-1357-43fa-a041-65cb7c7255fc"></p><p>点击<img src="'+nA+'" alt="image-20221009140921951">按钮，会弹出如下审核窗口</p><p><img src="'+dA+'" alt="9b19b6c5-6873-4cd3-8aaf-d4c80840d07a"></p><p>审核人员根据考生所填的信息，确定考生是否符合报考资格，并在审核表下方勾选审核结果。</p><p>审核通过的考生进入缴费阶段，未通过审核的考生可修改报考信息再提交审核。</p><p>取消资格、特许修改、自愿放弃这三项只在后台显示，审查系统无此三项；如若使用这三个按钮，请到后台系统点击。</p><p>报名，审核，缴费，编排考场完成后，进入笔试的考生会添加<img src="'+bA+'" alt="image-20221009141029081">按钮，点击按钮即可看到考生的准考证。</p><h3 id="编排考生" tabindex="-1"><a class="header-anchor" href="#编排考生" aria-hidden="true">#</a> 编排考生</h3><h4 id="笔试编排" tabindex="-1"><a class="header-anchor" href="#笔试编排" aria-hidden="true">#</a> 笔试编排</h4><p><img src="'+mA+'" alt="1bd6d225-d2cc-471e-afb8-d2c24c009c93"></p><p>笔试考场编排之前需完成创建考点、考场、准考证号，门贴标题，并确保创建的准确性。</p><p><img src="'+lA+'" alt="ef6a30b9-17e8-4bb5-8d2b-cccbac7b34d7"></p><p>弹出窗口会展示出每个职位的考生数，以及考场的座位数，请核对确保准确。</p><p><strong>编排方式</strong></p><p>1.自动打乱：指职位顺序不变，每个职位里的考生随机编排</p><p>2.报名顺序：指职位顺序不变，每个职位里的考生按报名顺序编排</p><p><strong>已编排人员处理方式</strong></p><p>1.清除数据，重新编排</p><p>2.保留数据，不对齐编排</p><p>注：适用于分批次编排的应用场景。若当前批次编排的考场所筛选的考生范围与之前重复，则还会重新编排。</p><blockquote><p>需要进行考场编排，职位中的笔试科目需填写，内容可以是除了数字 （1、2、3...)之外的文字，没有考试科目需要编排的岗位，笔试科目可以写无。职位中的笔试科目空白，考场编排是不出现这一岗位。</p></blockquote><h4 id="面试编排" tabindex="-1"><a class="header-anchor" href="#面试编排" aria-hidden="true">#</a> 面试编排</h4><p><img src="'+fA+'" alt="1666593410091"></p><p><strong>编排方式</strong></p><p>1.顺序分配：指职位顺序不变，对考场内每个职位的考生顺序分配</p><p>2.蛇形分配：指职位顺序不变，对考场内每个职位的考生蛇形分配</p><p><img src="'+hA+'" alt="1666751227639"></p><h3 id="留验单" tabindex="-1"><a class="header-anchor" href="#留验单" aria-hidden="true">#</a> 留验单</h3><p><img src="'+BA+'" alt="e82a1bf1-0e9e-40be-a617-80ba80440747"></p><p>留验单中按考场顺序排序，每个考场包含该考场的所有考生的照片，姓名，准考证号，身份证号，报考职位代码，座位号。座次表打印出来后，可用于考生签到。</p><p>点击任一考场，会弹出以下窗口</p><p><img src="'+EA+'" alt="e9947b28-8e90-43b0-b71e-8d3affb80b0a"></p><p>点击<img src="'+VA+'" alt="7b233af8-aa23-4870-b41a-af5a3172049e">即可打印出该考场的座次表</p><p>点击<img src="'+qA+'" alt="439ef1db-6c62-47af-93f2-a828a9a652f6">可打印出当前考点所有考场的座次表</p><p><img src="'+uA+'" alt="f166c425-b770-4e62-8974-71918170308a"></p><h3 id="桌贴" tabindex="-1"><a class="header-anchor" href="#桌贴" aria-hidden="true">#</a> 桌贴</h3><p><img src="'+QA+'" alt="6cfd3c13-942f-450d-8642-683b73c063d3"></p><p>桌贴中按考场顺序排序，每个考场包含该考场的所有考生的照片，姓名，准考证号，座位号。桌贴表打印出来并裁剪后，可按顺序贴在考场座位左（右）上角，以方便考生快速找到自己的座位。</p><p>点击任一考场，会弹出以下窗口</p><p><img src="'+vA+'" alt="4ce6ce31-90f8-4824-91c5-72344e5acc49"></p><p>点击<img src="'+CA+'" alt="52160538-8a0d-4259-bf94-b3c5172fa111">即可打印出该考场的桌贴表</p><p>点击<img src="'+ZA+'" alt="0dbf5f89-f5e8-475d-b8ca-c05598016088">可打印出当前考点所有考场的桌贴表</p><p><img src="'+zA+'" alt="image-20221009143544705"></p><h3 id="门贴" tabindex="-1"><a class="header-anchor" href="#门贴" aria-hidden="true">#</a> 门贴</h3><p><img src="'+wA+'" alt="0ad19a6c-d9ee-4bc3-8d57-62a50b42fff4"></p><p>门贴中按考场顺序排序，每个考场包含考试名称，考场名称，考生起始编号~考生终止编号。门贴打印出后可贴于考场门上，以方便考生快速找到自己的考场。</p><p>点击任一考场，会弹出以下窗口</p><p><img src="'+PA+'" alt="image-20221009143735968"></p><p>点击<img src="'+xA+'" alt="image-20221009143838631">即可打印出该考场的门贴</p><p>点击<img src="'+IA+'" alt="image-20221009143917441">可打印出当前考点所有考场的门贴</p><p><strong>注意事项</strong></p><blockquote><p>出现null，说明门贴标题没有填写，请在考试配置-笔试配置-门贴标题中填写完整。</p></blockquote><h3 id="笔试" tabindex="-1"><a class="header-anchor" href="#笔试" aria-hidden="true">#</a> 笔试</h3><p><img src="'+UA+'" alt="download_image (1)"></p><p>通过审核，并且缴费成功的考生进入笔试阶段。待考场，考生编排完成后，笔试页面按照笔试考生的考场号，座位号进行排序。</p><p><strong>考场索引表</strong></p><p>点击考场索引表</p><p><img src="'+MA+'" alt="image-20221009144840910"></p><p>会导出一份包含笔试考点、考场、报考岗位、考试科目、准考证号起止信息的数据表，方便监考老师和考生快速了解笔试安排。</p><p>表样式如下：</p><p><img src="'+RA+'" alt="image-20221009144953438"></p><p><strong>基础数据表</strong></p><p>点击基础索引表</p><p><img src="'+jA+'" alt="image-20221009145102188"></p><p>会导出一份包含考生准考证号，考生姓名，身份证号，手机号，考场号，座位号，报考岗位，岗位代码，总分，笔试岗位排名的数据表。</p><p>表样式如下：</p><p><img src="'+kA+'" alt="image-20221009150436864"></p><blockquote><p>待所有考试结束后，可以下载 <strong>基础数据表</strong>，按照原格式把所有成绩息填入表格中上传成绩。</p></blockquote><p><strong>详细数据表</strong></p><p>点击详细数据表</p><p><img src="'+KA+'" alt="image-20221009173047999"></p><p>会导出一份包含笔试考生准考证号，考场号，座位号，报考岗位，以及考生所有的<strong>报名信息</strong></p><p>表样式如下：</p><p><img src="'+GA+'" alt="image-20221009173149332"></p><p>点击<img src="'+DA+'" alt="image-20221009173233673">将填好的笔试成绩表导入到系统内，系统会自动根据笔试成绩，由高到低进行排序显示。</p><h3 id="面试" tabindex="-1"><a class="header-anchor" href="#面试" aria-hidden="true">#</a> 面试</h3><p><img src="'+yA+'" alt="c2d1ea2c-7ec5-4b34-bba0-ab8dfe84ac13"></p><p>按照笔试成绩排名和职位招录比确定进入面试的考生，系统以缴费状态来确定进入面试的考生数。</p><p><strong>面试人员</strong></p><p>点击<img src="'+XA+'" alt="f9ef7571-f6ac-4bc5-9eca-9600a7f33800">直接导入面试人员名单</p><p>格式如下：</p><p><img src="'+OA+'" alt="image-20221010133506680"></p><p>可把“报名编号”替换为“准考证号”进行考生数据导入</p><p><strong>面试缴费</strong></p><p>面试配置里面设置好费用支付的时间</p><p><img src="'+LA+'" alt="image-20221010133735847"></p><p>职位里面设置面试费用（不收费填0或者不填写）</p><p><img src="'+TA+'" alt="image-20221010133800411"></p><p>​ 进入面试的考生，面试费用支付时间开始时，在报名端点击缴费按钮直接进行支付宝或者微信扫码支付，系统后台可以看到考生的面试缴费信息。</p><p>点击<img src="'+SA+'" alt="image-20221010134241977">可导入导出所有进入面试审核阶段的考生信息，以缴费状态来确定最终进入面试的考生名单。</p><h3 id="体检" tabindex="-1"><a class="header-anchor" href="#体检" aria-hidden="true">#</a> 体检</h3><p><img src="'+YA+'" alt="image-20221010134448284"></p><p>按照面试成绩排名和职位招录比确定进入体检的考生名单</p><p><strong>体检人员</strong></p><p>点击<img src="'+HA+'" alt="image-20221010134554145">直接导入体检人员名单</p><p>格式如下：</p><p><img src="'+JA+'" alt="image-20221010134627484"></p><p>可把“报名编号”替换为“准考证号”进行考生数据导入</p><hr><h3 id="管理员" tabindex="-1"><a class="header-anchor" href="#管理员" aria-hidden="true">#</a> 管理员</h3><p>管理员（实现某个人员对某一场考试的管理）</p><p><img src="'+FA+'" alt="image-20221010135021706"></p><p>选择需要设置管理员的考试，点击管理进入</p><p><img src="'+WA+'" alt="image-20221010135213825"></p><p>点击管理员，添加用户</p><p><img src="'+NA+'" alt="image-20221010135244398"></p><p>设置用户名密码</p><p><img src="'+_A+'" alt="image-20221010135320746"></p><p>输入后台网址使用用户名密码登录系统</p><p><img src="'+$A+'" alt="image-20221010135447043"></p><p>主页面只有当前考试管理权限</p><p><img src="'+Aa+'" alt="image-20221010135525479"></p><hr><h3 id="通知公告" tabindex="-1"><a class="header-anchor" href="#通知公告" aria-hidden="true">#</a> 通知公告</h3><p>在考试项目中可直接管理该项目的通知公告，并发布文章</p><p><img src="'+aa+'" alt="image-20221101100800603"></p><h3 id="审查员" tabindex="-1"><a class="header-anchor" href="#审查员" aria-hidden="true">#</a> 审查员</h3><p>为了提高审核效率，系统还提供了专门为审查人员登录的审核后台</p><p><img src="'+sa+'" alt="image-20221010135905110"></p><p>系统管理员在该场考试的 <strong>用户</strong> 页面，点击<img src="'+pa+'" alt="image-20221010135932691"></p><p>会弹出以下窗口</p><p><img src="'+ea+'" alt="image-20221010140027352"></p><p>用户角色选择：【一级审核】即：审核后需二级复核。【二级复核】即：复核一级审核结果，同时为最终结果。</p><p><img src="'+ta+'" alt="image-20221010140058641"></p><p>选择好用户角色，设置用户名，选择该审核人员的审核范围，并设置密码后，点击保存，审核人员账号即创建完毕。</p><p>用户登录审查员账号后可进行密码修改</p><p><img src="'+ga+'" alt="image-20221101095313226"></p><p>多次尝试输入错误密码后会限制登录，进一步提高审查端安全性</p><p><img src="'+ca+'" alt="image-20221101095610836"></p><blockquote><p>审查人员权限仅限于笔试报名的审核，且当审核时间结束后，审查人员的权限终止，后续步骤需在系统后台完成。</p></blockquote><blockquote><p>该系统下所有审核人员账户用户名不能重复。</p></blockquote><blockquote><p>审查用户后台网址会在系统建设完成后提供，具体表现形式参考<strong>考生列表</strong></p></blockquote><p>（备注：审查系统无法审核的情况下是因为考试配置中审核时间还未开始。超级管理员不会受到此限制，如有问题可以及时与我们联系）</p><hr><h2 id="统计" tabindex="-1"><a class="header-anchor" href="#统计" aria-hidden="true">#</a> 统计</h2><p><img src="'+ia+'" alt="image-20221010140758493"></p><p>统计页面包含了各个职位的招考人数，开考比例，过审人数，缴费人数等。若某职位的缴费人数未达到开考比例，系统则会以红色突出显示。用户可根据公告调整招聘人数或撤销职位。</p><blockquote><p>撤销职位后，需通知报考该岗位考生在改报时间段内改报其他岗位或退款。</p></blockquote>',244);function fa(ha,Ba){const s=g("ExternalLinkIcon");return c(),i("div",null,[ra,A("blockquote",null,[A("p",null,[a("为了避免出错，请在创建考试时，将考试状态设置为 "),na,a("， 具体操作会在 "),A("strong",null,[A("a",da,[a("测试流程"),p(s)])]),a(" 中详细说明。处于测试阶段时，只有考生状态为高级用户时，才会看到该场考试（考生状态功能会在 "),A("strong",null,[A("a",ba,[a("人才库"),p(s)])]),a(" 中详细说明）。当报名功能测试完成后，即可恢复考试报名时间，并且将考试状态设置为"),ma,a("。")])]),la])}const Va=t(oa,[["render",fa],["__file","考试管理.html.vue"]]);export{Va as default};
